class RoomInfo {
    constructor(stringId, rusName) {
        this.stringId = stringId;
        this.rusName = rusName;
    }
}

const Room = [
    new RoomInfo('basketballHall', 'Баскетбольный зал'),
    new RoomInfo('swimmingPool', 'Бассейн'),
    new RoomInfo('banquetHall', 'Банкетный зал')
];

const TypeOfEvent = {
    PARTY: 'PARTY',
    CONCERT: '',
    SPORTS_MATCH: '',
    SPORTS_TRAINING: '',
    OTHER: ''
};

export {Room, TypeOfEvent}
